import styles from "./App.module.css";
import React from 'react';
import { Navbar } from "./";
import { Yo } from "./componentes/Yo/yo";



function App() {
  return (
    <div className={styles.App}>
      <Navbar/>
      <Yo/>
    </div>
  );
}

export default App;
